BigPictureFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./BigPicture.sol";
import "./Picture.sol";

contract BigPictureFactory {
    BigPicture[] private allBigPictures;

    function getAllBigPictures() public view returns (BigPicture[] memory) {
        return allBigPictures;
    }
 
    function createBigPicture(
        string memory _name,
        string memory _image,
        Picture[] memory _picturePart
    ) public {
        BigPicture newBigPicture = new BigPicture(
            _name,
            _image,
            _picturePart
        );
        allBigPictures.push(newBigPicture);
    }

}

Picture.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract Picture {

    uint8 order;
    string image;

    constructor (
        uint8 _order,
        string memory _image
    ) {
        order = _order;
        image= _image;
    }
}

BigPicture.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./Picture.sol";

contract BigPicture {

    string name;
    string image;
    Picture[] picturePart;

    constructor (
        string memory _name,
        string memory _image,
        Picture[] memory _picturePart
    ) {
        name = _name;
        image= _image;
        picturePart = _picturePart;
    }

}

